import Vue from 'vue'
import Router from 'vue-router'

import home from '@/components/home'
import hometest from '@/components/hometest'

import missioncontrol from '@/components/mission-control'
import businesses from '@/components/businesses'
import companies from '@/components/companies'
import error from '@/components/error-page'

import announcementItems from '@/components/announcements/items'
import businessItems from '@/components/businesses/items'
import companyItems from '@/components/companies/items'
import notesItems from '@/components/notes/items'

import bennoNavbar from '@/components/domo-navbar'
import navSecondary from '@/components/nav-secondary'
import bennoFooter from '@/components/domo-footer'

Vue.component('domo-navbar', bennoNavbar)
Vue.component('nav-secondary', navSecondary)
Vue.component('domo-footer', bennoFooter)

Vue.use(Router)

export default new Router({
  mode: 'history',
  routes: [
    { path: '/', name: 'home', component: home },
    { path: '/hometest', name: 'hometest', component: hometest },
    { path: '/mission-control', name: 'mission-control', component: missioncontrol },
    { path: '/businesses', name: 'businesses', component: businesses },
    { path: '/companies', name: 'companies', component: companies },

    { path: '/a/:slug', component: announcementItems },
    { path: '/b/:slug', component: businessItems },
    { path: '/c/:slug', component: companyItems },
    { path: '/n/:slug', component: notesItems },

    { path: '*', name: 'error-page', component: error }
  ],
  scrollBehavior (to, from, savedPosition) {
    if (to.hash) {
      return {
        selector: to.hash
      }
    } else {
      return { x: 0, y: 0 }
    }
  }

})
